import Link from 'next/link';

const Daily = (props) => {
  const city = 'Philadelphia'
  return (
    <div>
      <h1>Hi from Daily</h1>
      <Link href={`/city/weather?city=${city}`}><a>Go back</a></Link>
    </div>
  )
}

export default Daily;
